import { ReactComponent as Icon } from '../../assets/image/ic-search.svg';
import s from './style.module.css';

function Search({ onChange, onButtonSearchClick, value }) {
  return (
    <div className={s.search}>
      <input onChange={(e) => onChange(e.target.value)} className={s.input} placeholder="Поиск" />
      <Icon className={s.icon} onClick={onButtonSearchClick} />
    </div>
  );
}

export default Search;
